import axios from 'axios'
import React, { useEffect, useState } from 'react'


 const Home = () => {


  const [api,setApi]=useState([])


  useEffect(()=>{
    const api_link="https://restcountries.com/v3.1/all"
    axios.get(api_link)
    .then(response=>{
      setApi(response.data)
    })
  },[])


  console.log(api,"apii")




  return (
   <>

   <div>
    {

      api.map((ulke,i)=>
      <ul>
    <li key={i}>
    <img src={ulke.flags.png} />
    <p>{ulke.name.common}</p>

      </li>
      </ul>

      )
    }
   </div>
   </>
  )
}

export default Home;
